Smoke cloud • Sunsets aren’t the same anymore. Greece is experiencing one of the worst wildfires in years. Our region suffers the worst heatwave in decades and the hazy sky hurts the air quality. The sky will never be the same, until we do something about it. You can show your support with many ways.

